import React from 'react';
import { useNavigate } from 'react-router-dom';
import './UserSidebar.scss';
import { useTranslation } from 'react-i18next';

const UserSidebar: React.FC = () => {
    const { t } = useTranslation();

    const navigate = useNavigate();

    return (
        <div className="user-sidebar">
            <h3>{t('userSidebar.myAccount')}</h3>
            <ul>
                <li onClick={() => navigate('/user')}>{t('userSidebar.account')}</li>
                <li>{t('userSidebar.orders')}</li>
                <li onClick={() => navigate('/wishlist')}>{t('userSidebar.wishlist')}</li>
                <li>{t('userSidebar.addressBook')}</li>
                <li>{t('userSidebar.accountInfo')}</li>
                <li>{t('userSidebar.paymentMethods')}</li>
                <li>{t('userSidebar.newsletterSubscriptions')}</li>
            </ul>
        </div>
    );
};

export default UserSidebar;
